<img class="aligncenter wp-image-463" src="http://wikiceleb.com/wp-content/uploads/2017/12/Spain-2010-300x171.jpg" alt="" width="544" height="310" />

<strong><u>World Cup Qualifier Europe</u></strong>
<p style="text-align: justify;">The World Cup qualifier in Europe selects 14 countries for the FIFA World Cup and for 2018 FIFA World cup Russia qualifies being a host country. 52 countries who are the members of FIFA from Europe go for the preliminary competition where those 52 countries are divided into 9 groups in which 7 groups contain 6 teams and rest of the two groups contains only 5 teams.<a href="http://wikiceleb.com/england-road-russia-fifa-world-cup-2018/"> England</a>, <a href="http://wikiceleb.com/france-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">France</a>, <a href="http://wikiceleb.com/germany-road-russia-fifa-world-cup-2018/">Germany</a>, Italy, Netherlands and Spain are placed in a group containing 6 teams. Winners from each group qualify automatically and the eight best runners-up go for the playoffs from which 4 teams are selected. Thus, in this way, the Europe qualifier selects 14 nations for the FIFA World Cup.</p>
<p style="text-align: justify;">Spain was the group leader of Group G with 28 points at the end of the competition. They won 9 games and drew against Italy. Being a group leader Spain qualified for the FIFA World Cup 2018 leaving behind Italy for playoffs where Italy did not manage to qualify. The best performance of Spain during their qualifying round was against Liechtenstein with the final score of 0-8 where Liechtenstein did not score any.</p>
<img class="aligncenter wp-image-471" src="http://wikiceleb.com/wp-content/uploads/2017/12/spain-qualifier-300x163.jpg" alt="" width="552" height="300" />

